import "./index.css";

const Pricing = () => {
    return (
        <div className="Pricing">
            <p>
                Lorem ipsum dolor sit, amet consectetur adipisicing elit.
                Voluptas inventore quos necessitatibus soluta similique nam quas
                minus quasi nostrum. Saepe omnis sunt velit expedita, sit alias
                dolorem libero accusantium iure.
            </p>
        </div>
    );
};

export default Pricing;
